import React, {useState} from 'react'

export default class GetSheduleNew extends Comment {
  constructor(props) {
      super(props);
      this.state = {
          items: []
      }
  }

  componentDidMount() {
    fetch('https://mypew.ru/php/table.php', {
        method: 'POST',
        header: {
            'Accept': 'application/json',
            'Content-Type': 'application/json',
        },
        body: JSON.stringify({
            table : 3,
            date : '2022-04-11',
            day_count: 1,
        })
    })
    .then (res => res.json())
    .then ((response) => {
        this.setState({
            items: response
        });
    })
  }

}
